import { Form } from "react-bootstrap";

const ResearchBar = () => {
  return (
    <Form className="searchForm">
      <Form.Control
        type="search"
        placeholder="Search creatives"
        aria-label="Search"
      />
      <span className="bi bi-search"></span>
    </Form>
  );
};

export default ResearchBar;
